########################################################################################################################
testLengthStringSuccess:
  inputs:
    - origin_string: "morning"
  description: Tests that length.sl operation finishes with result = 7
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 7

testLengthSpecialCharacters:
  inputs:
    - origin_string: t%&e$\"
  description: Tests that length.sl operation finishes with result = 7
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 7
  result: SUCCESS

testLengthEmptyString:
  inputs:
    - origin_string: ""
  description: Tests that length.sl operation throws exception when the empty string is input
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 0
  result: SUCCESS

testLengthCharString:
  inputs:
    - origin_string: "a"
  description: Tests that length.sl operation finishes with result = 1, when the string is a character
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 1

testLengthStringVeryLong:
  inputs:
    - origin_string: ""
  description: Tests that length.sl operation finishes with result = 41120
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 41120

testLengthStringEscapeDoubleQuote:
  inputs:
    - origin_string: "1\\3\"5"
  description: Tests that length.sl operation finishes with result = 5
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 5

testLengthStringEscapeSingleQuote:
  inputs:
    - origin_string: '1''3'
  description: Tests that length.sl operation finishes with result = 3
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 3

testLengthStringMultipleLinesPipe:
  inputs:
    - origin_string: |
        line1
        line2
  description: Tests that length.sl operation finishes with result = 12 (incuding new line after each line)
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 12

testLengthStringMultipleLinesGreater:
  inputs:
    - origin_string: >
        line1
        line2
  description: Tests that length.sl operation finishes with result = 12 (including space after 1st line and new line after last line)
  testFlowPath: io.cloudslang.base.strings.length
  outputs:
    - length: 12